class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        if len(s) == 0:
            return t
        s, t = sorted(s), sorted(t)
        i, j = 0, 0
        diff_l = ""
        while i < len(s):
            if s[i] == t[j]:
                i += 1
                j += 1
            else:
                diff_l = t[j]
                j += 1
        return diff_l or t[-1]


if __name__ == '__main__':
    s = ""
    t = ""

    sol = Solution()
    print(sol.findTheDifference(s, t))
